import React from 'react';
//import PropTypes from 'prop-types';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHouse,  faGear } from '@fortawesome/free-solid-svg-icons';

import './sideBar.scss';
import PropsTesting from './PropsTesting';

const SideBarTitle = () => {
    return (
        <div className="sidebar-title">
            <span>UTMMMMM</span>
        </div>
    )
}

const SideBarItem = (props) => {
    return (
        <>
        <div>
            <IconItem {...props.iconexample[0]}/>

        </div>
        </>

    )
}

const TableSideBar = (props) => {
    return (
        <tr>
            <td>{ props.iconexample }</td>
        </tr>
    )
}

const IconItem = () => {
    const icons = [
        {id: 1, iconexample: faGear },
        {id: 2, iconexample: faGear },
        {id: 3, iconexample: faHouse },
        {id: 4, iconexample: faGear },
    ]
    return (
        <>
        <div className="sidebar-item">
            <div className="item-center">
            <span>ãƒ»</span>
            {icons.map((icon) => <FontAwesomeIcon key={icon.id} icon={icon.iconexample} />)}
            <a>Monitor</a>
            </div>
        </div>
        </>
    )
}

class SideBar extends React.Component {
    render() {
         return(
             <div className="sidebar-wrapper">
                 <SideBarTitle />
                 <div className="sidebar-item-wrapper"> 
                     <SideBarItem />
                     <IconItem />
                 </div>

             </div>

         );
    }
}

export default SideBar;
